/* © 2023 Organic Media Development. All Rights reserved. For more information: contact@organicmediadevelopment.com */

import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';

import Toolbar from '@mui/material/Toolbar';
import Link from '@mui/material/Link';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { ThemeOptions } from '@mui/material/styles';
import './App.css';
import Navbar from './navbar';
import logo from './images/omd_logo.png';
import logoO from './images/omdO.png';

export const themeOptions: ThemeOptions = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#ffffff',
      contrastText: '#000000',
    },
    secondary: {
      main: '#9acd32',
    },
    info: {
      main: '#9acd32',
    },
    success: {
      main: '#9acd32',
    },
  },
});


function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="mailto:contact@organicmediadevelopment.com">
        Organic Media Development.
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}
/*
   <div className="App">

     <div className="body">

        <Navbar/>


</div>
<div className="disclaimer">
© 2023 Organic Media Development.  <a href="mailto:contact@organicmediadevelopment.com">contact@organicmediadevelopment.com</a>
</div>

    </div>*/

function App() {
  return (
  	<ThemeProvider theme={themeOptions}>
      <CssBaseline />
 <AppBar position="relative">
        <Toolbar>
          <a  href="/contact"> <img src={logoO} className="App-logo-O" alt="logo" /></a>
          </Toolbar>
         </AppBar>


          {/* Footer */}
      <Box sx={{ bgcolor: 'background.paper', p: 6 }} component="footer">
        <Typography variant="h6" align="center" gutterBottom>
           <a  href="/contact"> <img src={logo} className="App-logo-page" alt="logo" /></a>
        </Typography>
        <Typography
          variant="subtitle1"
          align="center"
          color="text.secondary"
          component="p"
        >
         {/* Something here to give the footer a purpose!*/}
        </Typography>
        <Copyright />
      </Box>
      {/* End footer */}
    </ThemeProvider>


  );
}

export default App;
